def analyze_user_profile(choices):
    profiles = {
        'Êµ™Êº´‰∏ª‰πâËÄÖ': ['Áà±ÊÉÖ', 'Êµ™Êº´', 'ÊÑüÂä®'],
        'Êé®ÁêÜÂ§ßÂ∏à': ['ÊÇ¨Áñë', 'Êé®ÁêÜ', 'ÊÄùËÄÉ'], 
        'ÂñúÂâßËææ‰∫∫': ['ÂñúÂâß', 'ÂºÄÂøÉ', 'ÊîæÊùæ'],
        'ÂÜíÈô©ÂÆ∂': ['ÁßëÂπª', 'Â•áÂπª', 'Âà∫ÊøÄ'],
        'Ê≤ªÊÑàÁ≥ª': ['Ê≤ªÊÑà', 'ÂÆ∂Â∫≠', 'ÊîæÊùæ']
    }
    
    user_traits = []
    for profile, traits in profiles.items():
        if any(trait in str(choices.values()) for trait in traits):
            user_traits.append(profile)
    
    return user_traits if user_traits else ['Êé¢Á¥¢ËÄÖ']

def generate_personalized_recommendation(drama, user_traits):
    templates = {
        'Êµ™Êº´‰∏ª‰πâËÄÖ': [
            f"üíñ Ëøô‰ªΩÊµ™Êº´‰∏ì‰∏∫‰Ω†ÂÆöÂà∂ÔºÅ„Ää{drama['name']}„ÄãÂ∞ÜÂ∏¶‰Ω†‰ΩìÈ™å{random.choice(['ÂàªÈ™®Èì≠ÂøÉ', 'Ë∑®Ë∂äÊó∂Á©∫', 'ÂëΩ‰∏≠Ê≥®ÂÆö'])}ÁöÑÁà±ÊÉÖ",
            f"üéØ Ê†πÊçÆ‰Ω†ÁöÑÊµ™Êº´Âü∫Âõ†ÔºåÊàë‰ª¨ÈîÅÂÆö‰∫Ü„Ää{drama['name']}„Äã- {drama['memorable_line']}"
        ],
        'Êé®ÁêÜÂ§ßÂ∏à': [
            f"üîç Êé®ÁêÜËææ‰∫∫ÔºåÂáÜÂ§áÂ•ΩÊåëÊàò„Ää{drama['name']}„Äã‰∫ÜÂêóÔºüËøôÈÉ®ÂâßÊúâ{random.choice(['Â±ÇÂ±ÇÂèçËΩ¨', 'Á≤æÂ¶ôËØ°ËÆ°', 'ÊÑèÊÉ≥‰∏çÂà∞'])}ÁöÑË∞úÈ¢ò",
            f"üéØ ‰Ω†ÁöÑÈÄªËæëÊÄùÁª¥‰ºöÁà±‰∏ä„Ää{drama['name']}„Äã- {drama['memorable_line']}"
        ],
        'Ê≤ªÊÑàÁ≥ª': [
            f"üåº Ê≤ªÊÑàÊó∂ÂàªÔºÅ„Ää{drama['name']}„ÄãÂ∞±ÂÉè{random.choice(['ÂÜ¨Êó•ÊöñÈò≥', 'ÂøÉÁÅµÊåâÊë©', 'Ê∏©ÊüîÊã•Êä±'])}Ëà¨Ê∏©Êöñ",
            f"üéØ ‰∏∫‰Ω†ÁöÑÂøÉÁÅµÊåëÈÄâ‰∫Ü„Ää{drama['name']}„Äã- {drama['memorable_line']}"
        ]
    }
    
    for trait in user_traits:
        if trait in templates:
            return random.choice(templates[trait])
    
    return f"üéØ Êàë‰ª¨‰∏∫‰Ω†Á≤æÂøÉÂåπÈÖç‰∫Ü„Ää{drama['name']}„Äã- {drama['memorable_line']}"







