def get_drama_image(drama_name):
    """Ê†πÊçÆÂâßÈõÜÂêçÁß∞‰ªéGitHub‰ªìÂ∫ìËé∑ÂèñÂõæÁâáÂπ∂ËΩ¨Êç¢‰∏∫base64"""
    # ÂÆö‰πâÂâßÈõÜÂêçÁß∞‰∏éÂõæÁâáÊñá‰ª∂ÁöÑÊò†Â∞Ñ
    image_mapping = {
        'ÈªëÊöóËç£ËÄÄ': 'ÈªëÊöóËç£ËÄÄ.jpg',
        'Áà±ÁöÑËø´Èôç': 'Áà±ÁöÑËø´Èôç.jpg', 
        'È±øÈ±ºÊ∏∏Êàè': 'È±øÈ±ºÊ∏∏Êàè.jpg',
        'ËØ∑ÂõûÁ≠î1988': 'ËØ∑ÂõûÁ≠î1988.jpg',
        'ÊÄ™Â•áÁâ©ËØ≠': 'ÊÄ™Â•áÁâ©ËØ≠.jpg',
        'ÂêéÁøºÂºÉÂÖµ': 'ÂêéÁøºÂºÉÂÖµ.webp',
        'ËΩÆÂà∞‰Ω†‰∫Ü': 'ËΩÆÂà∞‰Ω†‰∫Ü.jpg',
        'ÂàùÊÅã': 'ÂàùÊÅã.webp',
        'Áü≥Á∫™ÂÖÉ': 'Áü≥Á∫™ÂÖÉ.png'
    }
    
    if drama_name not in image_mapping:
        return None
    
    try:
        # ËØ∑ÊõøÊç¢‰∏∫‰Ω†ÁöÑGitHub‰ø°ÊÅØ
        github_username = "Luka077-jht"
        repo_name = "yyyx"
        branch = "main"
        folder_path = "ËΩØ‰ª∂ÂõæÁâáÂ∫ì"  # Â¶ÇÊûúÂõæÁâáÂú®Â≠êÊñá‰ª∂Â§π‰∏≠
        
        image_filename = image_mapping[drama_name]
        image_url = f"https://raw.githubusercontent.com/{github_username}/{repo_name}/{branch}/{folder_path}/{image_filename}"
        
        response = requests.get(image_url)
        response.raise_for_status()
        
        image_data = response.content
        image_base64 = base64.b64encode(image_data).decode('utf-8')
        
        return image_base64
        
    except Exception as e:
        print(f"‰ªéGitHubËé∑ÂèñÂõæÁâáÂ§±Ë¥•: {e}")
        return None
        
