def show_rating_stats():
    st.markdown('<div class="main-header">üé¨ Âπ¥Â∫¶ÂâßÈõÜËôéÊâëËØÑÂàÜÊ¶ú</div>', unsafe_allow_html=True)
    
    # ‰æßËæπÊ†è - Á≠õÈÄâÂô®
    with st.sidebar:
        st.header("üîç Á≠õÈÄâËÆæÁΩÆ")
        
        # Á±ªÂûãÁ≠õÈÄâ
        genres = ['ÂÖ®ÈÉ®'] + list(st.session_state.shows_df['genre'].unique())
        selected_genre = st.selectbox("ÂâßÈõÜÁ±ªÂûã", genres)
        
        # Âπ¥‰ªΩÁ≠õÈÄâ
        years = ['ÂÖ®ÈÉ®'] + sorted(st.session_state.shows_df['release_year'].unique(), reverse=True)
        selected_year = st.selectbox("ÂèëË°åÂπ¥‰ªΩ", years)
        
        # ËØÑÂàÜËåÉÂõ¥
        min_score, max_score = st.slider(
            "ËØÑÂàÜËåÉÂõ¥", 
            min_value=0.0, 
            max_value=10.0, 
            value=(8.0, 9.5),
            step=0.1
        )
        
        # Â∫îÁî®Á≠õÈÄâ
        filtered_shows = st.session_state.shows_df.copy()
        if selected_genre != 'ÂÖ®ÈÉ®':
            filtered_shows = filtered_shows[filtered_shows['genre'] == selected_genre]
        if selected_year != 'ÂÖ®ÈÉ®':
            filtered_shows = filtered_shows[filtered_shows['release_year'] == selected_year]
        filtered_shows = filtered_shows[
            (filtered_shows['avg_rating'] >= min_score) & 
            (filtered_shows['avg_rating'] <= max_score)
        ]
    
    # ‰∏ªÂÜÖÂÆπÂå∫ - ‰∏§ÂàóÂ∏ÉÂ±Ä
    col1, col2 = st.columns([2, 1])
    
    with col1:
        st.subheader("üì∫ ÂâßÈõÜËØÑÂàÜÂå∫")
        
        # ÂâßÈõÜÂ±ïÁ§∫ÂíåËØÑÂàÜ
        for _, show in filtered_shows.iterrows():
            with st.container():
                st.markdown(f'<div class="show-card">', unsafe_allow_html=True)
                
                # ÂâßÈõÜÊ†áÈ¢òÂíåÂü∫Êú¨‰ø°ÊÅØ
                col_a, col_b = st.columns([3, 1])
                with col_a:
                    st.write(f"### {show['title']}")
                    st.write(f"**Á±ªÂûã:** {show['genre']} | **Âπ¥‰ªΩ:** {show['release_year']}")
                    st.write(show['description'])
                
                with col_b:
                    st.markdown(f'<div class="score-badge">ËØÑÂàÜ: {show["avg_rating"]}</div>', 
                               unsafe_allow_html=True)
                    st.write(f"üë• {show['rating_count']}‰∫∫ËØÑÂàÜ")
                
                # ËôéÊâëÂºèÁÉ≠ËØÑÂíåÊ¢ó
                memes, comments = get_show_memes(show['id'])
                
                if memes:
                    st.write("**üî• ÁÉ≠Ê¢ó:**")
                    meme_cols = st.columns(len(memes))
                    for i, meme in enumerate(memes):
                        with meme_cols[i]:
                            st.markdown(f'<div class="meme-tag">{meme}</div>', unsafe_allow_html=True)
                
                # ËØÑÂàÜÊªëÂùó
                st.markdown('<div class="rating-section">', unsafe_allow_html=True)
                user_rating = st.slider(
                    f"‰∏∫„Ää{show['title']}„ÄãËØÑÂàÜ",
                    min_value=0.0,
                    max_value=10.0,
                    value=st.session_state.user_ratings.get(show['id'], show['avg_rating']),
                    step=0.1,
                    key=f"rating_{show['id']}"
                )
                
                # ‰øùÂ≠òÁî®Êà∑ËØÑÂàÜ
                if st.button(f"Êèê‰∫§ËØÑÂàÜ", key=f"btn_{show['id']}"):
                    st.session_state.user_ratings[show['id']] = user_rating
                    st.success(f"Â∑≤‰∏∫„Ää{show['title']}„ÄãËØÑÂàÜ: {user_rating}")
                
                st.markdown('</div>', unsafe_allow_html=True)
                
                # ÊòæÁ§∫ÁÉ≠ËØÑ
                if comments:
                    st.write("**üí¨ ËôéÊâëÁÉ≠ËØÑ:**")
                    for comment in comments:
                        st.markdown(f'<div class="hot-comment">{comment}</div>', unsafe_allow_html=True)
                
                st.markdown('</div>', unsafe_allow_html=True)
                st.write("---")
    
    with col2:
        st.subheader("üèÜ ÂÆûÊó∂ÊéíË°åÊ¶ú")
        
        # ÊéíÂ∫èÈÄâÈ°π
        sort_by = st.selectbox("ÊéíÂ∫èÊñπÂºè", ["ÁªºÂêàËØÑÂàÜ", "ËØÑÂàÜ‰∫∫Êï∞", "ÊúÄÊñ∞Âπ¥‰ªΩ"])
        
        if sort_by == "ÁªºÂêàËØÑÂàÜ":
            ranked_shows = filtered_shows.sort_values('avg_rating', ascending=False)
        elif sort_by == "ËØÑÂàÜ‰∫∫Êï∞":
            ranked_shows = filtered_shows.sort_values('rating_count', ascending=False)
        else:
            ranked_shows = filtered_shows.sort_values('release_year', ascending=False)
        
        # ÊòæÁ§∫ÊéíË°åÊ¶ú
        for i, (_, show) in enumerate(ranked_shows.head(10).iterrows(), 1):
            medal = "ü•á" if i == 1 else "ü•à" if i == 2 else "ü•â" if i == 3 else f"{i}."
            
            st.write(f"{medal} **{show['title']}**")
            st.write(f"  ËØÑÂàÜ: **{show['avg_rating']}** üåü ({show['rating_count']}‰∫∫)")
            
            # ÊòæÁ§∫Áî®Êà∑‰∏™‰∫∫ËØÑÂàÜÔºàÂ¶ÇÊûúÊúâÔºâ
            user_score = st.session_state.user_ratings.get(show['id'])
            if user_score:
                st.write(f"  ÊàëÁöÑËØÑÂàÜ: **{user_score}** ‚≠ê")
            
            st.write("---")
        
        # ÁªüËÆ°‰ø°ÊÅØ
        st.subheader("üìä Êï∞ÊçÆÁªüËÆ°")
        st.write(f"ÊÄªÂâßÈõÜÊï∞: **{len(filtered_shows)}**")
        st.write(f"Âπ≥ÂùáËØÑÂàÜ: **{filtered_shows['avg_rating'].mean():.1f}**")
        st.write(f"ÊÄªËØÑÂàÜ‰∫∫Êï∞: **{filtered_shows['rating_count'].sum():,}**")
        
        # Áî®Êà∑ËØÑÂàÜÁªüËÆ°
        if st.session_state.user_ratings:
            st.write(f"ÊàëÂ∑≤ËØÑÂàÜ: **{len(st.session_state.user_ratings)}** ÈÉ®ÂâßÈõÜ")
            avg_user_rating = np.mean(list(st.session_state.user_ratings.values()))
            st.write(f"ÊàëÁöÑÂπ≥ÂùáËØÑÂàÜ: **{avg_user_rating:.1f}**")

